import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
var bad = "o";
var good = "x";

  const gameMap = 
   [
    [bad, bad, bad],
    [good, bad, bad],
    [bad, bad, bad],
    [bad, bad, bad],
   ];
  console.log(gameMap);




  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit  <code>src/App.js</code> and save to reload.
        </p>
        <table>
          <tbody>
        {gameMap.map(rowItem => (<tr>
          {console.log({rowItem})}
          {rowItem.map(cellItem => (
            <td>
              {cellItem}
